var validate_code_image = $("[alt]:first");
var validate_code_box = document.getElementById("captcha");

validate_code_image.get(0).onload = function() {

			validate_code_box.value = "";

			var myMat = imread(validate_code_image.get(0));

			Convert_to_Bitbox(myMat.data);

			if (!Crack()) validate_code_image.click();
			else
				if (window.location.href.indexOf("err=0")<0) get_options_and_login_in();
			}


function get_options_and_login_in(){
  var auto = false;
  chrome.storage.sync.get({
    autoLogin: false,
	user: '',
	pass: ''
  }, function(items) {

	if (items.autoLogin)
	{
		document.getElementById('user').value = items.user;
		document.getElementById('pass').value = items.pass;
		$(":submit:first").click();
	}

  });
  return auto;
}

var iCanvas = document.createElement("canvas"),
    iCtx = iCanvas.getContext("2d");


var bitbox = new Array(100);

function Convert_to_Bitbox(data)
{
	for (var i = 0; i < 100; i++)
	{
		bitbox[i] = new Array(40);
		for (var j = 0; j < 40; j++)
		{
			var index = i + j * 100;
			var color = (data[index * 4] * 30 + data[index * 4 + 1] * 59 + data[index * 4 + 2] * 11 + 50) / 100;
			if (color < 160)
			{
				bitbox[i][j] = 1;
			}
			else
			{
				bitbox[i][j] = 0;
			}
		}
	}
}

function Crack()
{
	var isStart = false;
	var isData = false;
	var startx = 0, starty = 0, endx = 0, endy = 0;
	for (var i = 0; i < 100; i++)
	{
		isData = false;

		for (var j = 0; j < 40; j++)
		{
			if (bitbox[i][j] == 1)
			{
				isData = true;
				break;
			}
		}

		if (isStart)
		{
			if (!isData)
			{
				endx = i - 1;
				isStart = false;
				for (var k = 0; k < 40; k++)
				{
					var haveRow = false;
					for (var j = startx; j <= endx; j++)
						if (bitbox[j][k] == 1)
						{
							haveRow = true;
							break;
						}
					if (haveRow)
					{
						starty = k;
						break;
					}
				}
				for (var k = 40 - 1; k >= 0; k--)
				{
					var haveRow = false;
					for (var j = startx; j <= endx; j++)
						if (bitbox[j][k] == 1)
						{
							haveRow = true;
							break;
						}
					if (haveRow)
					{
						endy = k;
						break;
					}
				}
				var tmp = "";
				var cnt = 0;
				var lab = 0;
				for (var k = starty; k <= endy; k++)
				{
					if (cnt == 96) break;
					for (var j = startx; j <= endx; j++)
					{
						if (cnt == 96) break;
						lab++;
						if (lab % 2 == 1)
						{
							if (bitbox[j][k] == 1) tmp += "1"; else tmp += "0";
							cnt++;
						}
					}
				}

				lab = 0;
				for (var k = endy; k >= starty; k--)
				{
					if (cnt == 96) break;
					for (var j = endx; j >= startx; j--)
					{
						if (cnt == 96) break;
						lab++;
						if (lab % 2 == 0)
						{
							if (bitbox[j][k] == 1) tmp += "1"; else tmp += "0";
							cnt++;
						}
					}
				}
				for (var j = cnt; j < 96; j++)
					tmp += "0";
				var wid = endx - startx + 1;
				var hgt = endy - starty + 1;

				if (wid < 10 )
				{
					tmp += "0";
					tmp += wid;
				}
				else
				{
					tmp += wid;
				}
				if (hgt < 10 )
				{
					tmp += "0";
					tmp += hgt;
				}
				else
				{
					tmp += hgt;
				}

				var res = match(tmp);

				if (res != '?')
				{
					validate_code_box.value += res;
				}
				else
				{
					return false;
				}
				//alert(tmp);
			}
		}
		else
		{
			if (isData)
			{
				startx = i;
				isStart = true;
			}
		}
	}
	return true;
}

function cmpn(str1, str2, valve)
{
	 if (str1[96] != str2[96]) return -1;
	 if (str1[97] != str2[97]) return -1;
	 if (str1[98] != str2[98]) return -1;
	 if (str1[99] != str2[99]) return -1;

	var cnt = 0;
	for (var i = 0; i < 96; i++)
	{
		if (str1.charAt(i) != str2.charAt(i)) cnt++;
		if (cnt >= valve) return -1;
	}
	return cnt;
}

function iResize(__width, __height)
{
    iCanvas.width = __width;
    iCanvas.height = __height;
}

function imread(__image)
{
    var width = __image.width,
        height = __image.height;
    iResize(width, height);
    iCtx.drawImage(__image, 0, 0);
    var imageData = iCtx.getImageData(0, 0, width, height),
        tempMat = new Mat(height, width, imageData.data);
    imageData = null;
    iCtx.clearRect(0, 0, width, height);
    return tempMat;
}

function Mat(__row, __col, __data, __buffer)
{
    this.row = __row || 0;
    this.col = __col || 0;
    this.channel = 4;
    this.buffer = __buffer || new ArrayBuffer(__row * __col * 4);
    this.data = new Uint8ClampedArray(this.buffer);
    __data && this.data.set(__data);
    this.bytes = 1;
    this.type = "CV_RGBA";
}

